const notes = [
    {
        id: 1,
        title: "Array",
        content: "An array is a collection of items of same data type stored at contiguous memory locations. This makes it easier to calculate the position of each element by simply adding an offset to a base value."
    },
    {
        id: 2,
        title: "Dynamic Programming",
        content: "Dynamic Programming is a technique in computer programming that helps to efficiently solve a class of problems."
    }
];

export default notes;
